import React from 'react';
import { useHistory } from 'react-router-dom';

const Home = () => {
  const history = useHistory();

  const handleSiparisFormuClick = () => {
    history.push('/siparis-formu');
  };

  return (
    <div>
      <h1>Hoş Geldiniz!</h1>
      <p>İhtiyacınız olan ürünü seçin ve sipariş formunu doldurun.</p>
      <button onClick={handleSiparisFormuClick}>Sipariş Formu</button>
    </div>
  );
};

export default Home;
